import './App.css';
import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';
import {
  BrowserRouter as Router,
  Switch,
  Routes,
  Route,
  Link,
} from "react-router-dom";


export default class App extends Component {

  render() {
    return (
      <Router>
        <Navbar/>
        <div className='container my-3'>
          <Routes>
            <Route exact path="/News" element={<News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'business'}/>}/>
            {/* <News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'business'}/> */}
          </Routes>
        </div>
      </Router>
    )
  }
}
